fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_osteopetrosis_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        :autosomal_dominant_disease,
        :osteopetrosis,
        :spinal_disease ;
    :has_definition "An osteopetrosis characterized by autosomal dominant inheritance of sclerosis predominantly involving the spine, the pelvis, and the skull base, bone fragility and dental abscesses that has_material_basis_in mutation in the CLCN7 gene on chromosome 16p13." ;
    :has_exact_synonym "Albers-Schonberg osteopetrosis"@en,
        "OPTA2"@en,
        "autosomal dominant Albers-Schonberg disease"@en,
        "autosomal dominant osteopetrosis type II"@en,
        "osteopetrosis autosomal dominant type 2"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance that has_material_basis_in mutation in the OSTM1 gene on chromosome 6q21." ;
    :has_exact_synonym "OPTB5"@en,
        "infantile malignant osteopetrosis 3"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_8 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance that has_material_basis_in homozygous mutation in the SNX10 gene on chromosome 7p15." ;
    :has_exact_synonym "OPTB8"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance that has_material_basis_in homozygous or compound heterozygous mutation in the CA2 gene on chromosome 8q21." ;
    :has_exact_synonym "Guibaud-Vainsel syndrome"@en,
        "OPTB3"@en,
        "autosomal recessive osteopetrosis 3 with renal tubular acidosis"@en,
        "carbonic anhydrase II deficiency"@en,
        "marble brain disease"@en,
        "osteopetrosis with renal tubular acidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance that has_material_basis_in homozygous or compound heterozygous mutation in the TCIRG1 gene on chromosome 11q13.2." ;
    :has_exact_synonym "OPTB1"@en,
        "autosomal recessive Albers-Schonberg disease"@en,
        "infantile malignant osteopetrosis 1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance that has_material_basis_in homozygous mutation in the TNFSF11 gene on chromosome 13q14." ;
    :has_exact_synonym "OPTB2"@en,
        "mild autosomal recessive form osteopetrosis"@en,
        "osteoclast-poor osteopetrosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance that has_material_basis_in homozygous or compound heterozygous mutation in the CLCN7 gene on chromosome 16p13." ;
    :has_exact_synonym "OPTB4"@en,
        "infantile malignant osteopetrosis 2"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance of that has_material_basis_in mutation in the PLEKHM1 gene on chromosome 17q21.31." ;
    :has_exact_synonym "OPTB6"@en,
        "autosomal recessive osteopetrosis intermediate form"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_osteopetrosis_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteopetrosis ;
    :has_definition "An osteopetrosis characterized by autosomal recessive inheritance that has_material_basis_in homozygous or compound heterozygous mutation in the TNFRSF11A gene on chromosome 18q21." ;
    :has_exact_synonym "OPTB7"@en,
        "autosomal recessive osteoclast-poor osteopetrosis with hypogammaglobulinemia"@en,
        "autosomal recessive osteopetrosis type 7"@en,
        "osteoclast-poor osteopetrosis with hypogammaglobulinemia"@en,
        "osteopetrosis-hypogammaglobulinemia syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_2b rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by pigmentary abnormalities of the hair, skin, and eyes, congenital sensorineural hearing loss, and absence of lateral displacement of the inner canthus of each eye that has_material_basis_in variation in the chromosome region 1p21-p13.3." ;
    :has_exact_synonym "WS2B"@en,
        "Waardenburg syndrome type IIB"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_1 rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by autosomal dominant inheritance of congenital deafness, pigmentation anomalies of eyes, hair, and skin,and dystopia canthorum that has_material_basis_in heterozygous mutation in the PAX3 gene on chromosome 2q36." ;
    :has_exact_synonym "WS1"@en,
        "Waardenburg syndrome type I"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_3 rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by upper limb anomalies, congenital hearing loss, dystopia canthorum and pigmentation anomalies of eyes, hair, and skin that has_material_basis_in heterozygous or homozygous mutation in the PAX3 gene on chromosome 2q36." ;
    :has_exact_synonym "Klein-Waardenburg syndrome"@en,
        "WS3"@en,
        "Waardenburg syndrome type III"@en,
        "Waardenburg syndrome with upper limb anomalies"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_2a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :digenic_inheritance ],
        :digenic_disease,
        :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by pigmentary abnormalities of the hair, skin, and eyes, congenital sensorineural hearing loss, and absence of lateral displacement of the inner canthus of each eye that has_material_basis_in heterozygous mutation in the MITF gene on chromosome 3p13." ;
    :has_exact_synonym "WS2A"@en,
        "Waardenburg syndrome type IIA"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_2c rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by pigmentary abnormalities of the hair, skin, and eyes, congenital sensorineural hearing loss, and absence of lateral displacement of the inner canthus of each eye that has_material_basis_in variation in the chromosome region 8p23." ;
    :has_exact_synonym "WS2C"@en,
        "Waardenburg syndrome type IIC"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_4a rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by pigmentary abnormalities of the hair, skin, and eyes, congenital sensorineural hearing loss, and Hirschsprung disease that has_material_basis_in heterozygous or homozygous mutation in the EDNRB gene on chromosome 13q22." ;
    :has_exact_synonym "WS4A"@en,
        "Waardenburg syndrome type IVA"@en,
        "Waardenburg syndrome with Hirschsprung disease type 4A"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_4b rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by pigmentary abnormalities of the hair, skin, and eyes, congenital sensorineural hearing loss, and Hirschsprung disease that has_material_basis_in homozygous and heterozygous mutation in the EDN3 gene on chromosome 20q13." ;
    :has_exact_synonym "WS4B"@en,
        "Waardenburg syndrome type IVB"@en,
        "Waardenburg syndrome with Hirschsprung disease type 4B"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_4c rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by pigmentary abnormalities of the hair, skin, and eyes, congenital sensorineural hearing loss, and Hirschsprung disease that has_material_basis_in heterozygous mutation in the SOX10 gene on chromosome 22q13." ;
    :has_exact_synonym "WS4C"@en,
        "Waardenburg syndrome type IVC"@en,
        "Waardenburg syndrome with Hirschsprung disease type 4C"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waardenburg_syndrome_type_2e rdfs:subClassOf :waardenburg_syndrome ;
    :has_definition "A Waardenburg syndrome characterized by pigmentary abnormalities of the hair, skin, and eyes, congenital sensorineural hearing loss, and absence of lateral displacement of the inner canthus of each eye that has_material_basis_in heterozygous mutations in the SOX10 gene on chromosome 22q13." ;
    :has_exact_synonym "WS2E"@en,
        "WS2E with or without neurological involvement"@en,
        "Waardenburg syndrome type 2E with or without neurologic involvement"@en,
        "Waardenburg syndrome type IIE"@en,
        "hypogonadotropic hypogonadism with anosmia and deafness with or without hypopigmentation"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gaucher_s_disease_type_i rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :gaucher_s_disease ;
    :has_definition "A Gaucher's disease characterized by absence of primary central nervous system involvement that has_material_basis_homozygous or compound heterozygous mutation in the GBA1 gene on chromosome 1q22." ;
    :has_exact_synonym "GD1",
        "Acid Beta-Glucosidase Deficiency"@en,
        "GD I"@en,
        "Gaucher Disease, Noncerebral Juvenile"@en,
        "Gba Deficiency"@en,
        "Glucocerebrosidase Deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gaucher_s_disease_type_ii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :gaucher_s_disease ;
    :has_definition "A Gaucher's disease characterized by rapid neurologic deterioration with cranial nerve and extrapyramidal tract involvement that has_material_basis_in homozygous or compound heterozygous mutation in the GBA1 gene on chromosome 1q22." ;
    :has_exact_synonym "GD2",
        "GD II"@en,
        "Gaucher Disease, Acute Neuronopathic Type"@en,
        "Infantile Cerebral Gaucher Disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gaucher_s_disease_type_iii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :gaucher_s_disease ;
    :has_definition "A Gaucher's disease characterized by later onset and slower progession of neurological deterioration compared to type II that has_material_basis_in homozygous or compound heterozygous mutation in the GBA1 gene on chromosome 1q22." ;
    :has_exact_synonym "GD III"@en,
        "Gaucher Disease, Chronic Neuronopathic Type"@en,
        "Gaucher Disease, Juvenile And Adult, Cerebral"@en,
        "Gaucher Disease, Subacute Neuronopathic Type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gaucher_s_disease_perinatal_lethal rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :gaucher_s_disease ;
    :has_definition "A Gaucher's Disease characterized by perinatal lethality and rapid progression of neurological deterioration that has_material_basis_in homozygous or compound heterozygous mutation in the GBA1 gene on chromosome 1q22." ;
    :has_exact_synonym "Fetal Gaucher Disease"@en,
        "Gaucher Disease, Collodion Type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atypical_gaucher_s_disease_due_to_saposin_c_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :gaucher_s_disease ;
    :has_definition "A Gaucher's disease that has_material_basis_in compound heterozygous mutation in the PSAP gene on chromosome 10q22.1." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_preaxial_hallux_varus_syndrome rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by autosomal dominant inheritance of short thumbs and first toes with abduction of these digits, the shortening involves the metacarpals, metatarsals, and distal phalanges." ;
    :has_exact_synonym "Christian brachydactyly"@en,
        "preaxial brachydactyly with hallux varus and thumb abduction"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ballard_syndrome rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by autosomal dominant inheritance of hypoplasia of the distal phalanges of the ulnar side of the hand and shortening of one or more metacarpals but normal stature." ;
    :has_exact_synonym "Ballard type brachydactyly"@en,
        "Pitt-Williams brachydactyly"@en,
        "brachydactyly types B and E combined"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_a1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :brachydactyly ;
    :has_definition "A brachydactyly characterized by rudimentary or fused middle phalanges of all the digits and shortened proximal phalanges of the thumbs and big toes." ;
    :has_exact_synonym "BDA1"@en,
        "Farabee type brachydactyly"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_a2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :brachydactyly ;
    :has_definition "A brachydactyly characterized by autosomal dominant inheritance of malformations of the middle phalanx of the index finger and anomalies of the second toe that has_material_basis_in heterozygous mutation in the BMPR1B gene on chromosome 4q or in the GDF5 gene on chromosome 20q11 or heterozygous duplication in a regulatory element of BMP2 on chromosome 20p12." ;
    :has_exact_synonym "BDA2"@en,
        "Mohr-Wriedt type brachydactyly"@en,
        "brachymesophalangy II"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_a3 rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by shortening of the middle phalanx of the fifth finger resulting in radial curvature of the fifth finger." ;
    :has_exact_synonym "BDA3"@en,
        "brachydactyly-clinodactyly"@en,
        "brachymesophalangy V"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_a4 rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by autosomal dominant inheritance of hypoplastic middle phalanges, brachymesophalangy affecting mainly the 2nd and 5th digits and congenital talipes calcaneovalgus." ;
    :has_exact_synonym "BDA4"@en,
        "Temtamy type brachydactyly"@en,
        "brachymesophalangy II and V"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_a6 rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by brachymesophalangy with mesomelic short limbs, absence or hypoplasia of second phalanges with synostosis of the remaining phalanges, and carpal and tarsal coalitions." ;
    :has_exact_synonym "BDA6"@en,
        "Osebold-Remondini syndrome"@en,
        "brachymesophalangy with mesomelic short limbs and carpal and tarsal osseous abnormalities"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_b1 rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by short middle phalanges, rudimentary or absent terminal phalanges and nail aplasia that has_material_basis_in heterozygous mutation in the ROR2 gene on chromosome 9q22." ;
    :has_exact_synonym "BDB1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_c rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :brachydactyly ;
    :has_definition "A brachydactyly characterized by rachymesophalangy of the index, middle and little fingers, hyperphalangy of the index and middle finger, and shortening of the 1st metacarpal that has_material_basis_in heterozygous mutation in the GDF5 gene on chromosome 20q11." ;
    :has_exact_synonym "BDC"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_d rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :brachydactyly ;
    :has_definition "A brachydactyly characterized by short and broad terminal phalanges of the thumbs and big toes that has_material_basis_in mutation in the HOXD13 gene on chromosome 2q31.1." ;
    :has_exact_synonym "BDD"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_e1 rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by shortening of the fingers,mainly in the metacarpals and metatarsals, that has_material_basis_in heterozygous mutation in the HOXD13 gene on chromosome 2q31." ;
    :has_exact_synonym "BDE1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mononen_karnes_senac_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :finger ;
                                    rdf:rest :nil ] ] ] ],
        :brachydactyly ;
    :has_definition "A brachydactyly characterized by short, abducted thumbs and great toes." ;
    :has_exact_synonym "Mononen type brachydactyly"@en,
        "short and abducted thumbs and great toes"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_a1b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :brachydactyly_type_a1 ;
    :has_definition "A brachydactyly type A1 characterized by shortened middle phalanges of all the digits and shortened proximal phalanges of the thumbs and big toes but normal stature that has_material_basis_in variation in the chromosome region 5p13.3-p13.2." ;
    :has_exact_synonym "BDA1B"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_b2 rdfs:subClassOf :brachydactyly ;
    :has_definition "A brachydactyly characterized by hypoplasia/aplasia of distal phalanges, distal symphalangism, fusion of carpal/tarsal bones, and partial cutaneous syndactyly that has_material_basis_in mutations in the NOG gene on chromosome 17q22." ;
    :has_exact_synonym "BDB2"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_e2 rdfs:subClassOf :brachydactyly ;
    :has_definition "A characterized byautosomal dominant inheritance of short stature, tooth abnormalities, and short metacarpals and metatarsals that has_material_basis_in heterozygous mutation in the PTHLH gene on chromosome 12p." ;
    :has_exact_synonym "BDE2"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_type_a1c rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :brachydactyly_type_a1 ;
    :has_definition "A brachydactyly type A1 has_material_basis_in homozygous or heterozygous mutation in the GDF5 gene on chromosome 20q11." ;
    :has_exact_synonym "BDA1C"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

