        "hereditary congenital controlateral synkinesia"@en,
        "hereditary congenital mirror movements"@en,
        "isolated congenital controlateral synkinesia"@en,
        "isolated congenital mirror movements"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

