    :has_definition "A lymphoproliferative syndrome characterized by one or more enlarged lymph nodes containing cells with hyaline-vascular, plasmacytic, or mixed appearance microscopically." ;
    :has_exact_synonym "angiofollicular lymph hyperplasia"@en,
