    :has_definition "A dysostosis characterized by polysyndactyly of hands and/or feet, mirror image duplication of the feet, nasal defects, and loss of identity between fibula and tibia that has_material_basis_in heterozygous inheritance of small (less than 80kb) duplications in a SHH regulatory element located in intron 5 of the LMBR1 gene on chromosome 7q36.3." ;
    :has_exact_synonym "MIPduplication of fibuland ulna with absence of tibia and radius"@en,
